pragma solidity ^0.4.24;

import "./interface/TokenRegistryInterface.sol";
import "./interface/TokenDealerInterface.sol";
import "zeppelin-solidity/contracts/ownership/Ownable.sol";

contract S3DProtocol is Ownable{

    /*==============================
    =            EVENTS            =
    ==============================*/
    
    event onTokenPurchase(
        address indexed customerAddress,
        string indexed symbol,
        uint256 incomingTokenAmount,
        uint256 tokensMinted,
        address indexed referredBy
    );

    string constant private ethSymbol  = "eth";
    TokenRegistryInterface private tokenRegistry = TokenRegistryInterface(0xfb046c1da17af580b4740eb04054bd7d235dfcdf);
    mapping(string => address) tokenDealerMap;

    function setTokenRegistryAddress(address tokenRegistryAddress) public view onlyOwner{
        tokenRegistry = TokenRegistryInterface(tokenRegistryAddress);
    }

    function addDealer(string symbol, address dealerAddress) public view onlyOwner{
        tokenDealerMap[symbol] = dealerAddress;
    }

    function tokenBuy(string symbol, uint256 incomingTokenAmount, address referredBy) public returns(uint256){
        return buy(symbol, incomingTokenAmount, referredBy);
    }

    function ethBuy(string symbol, address referredBy) public payable returns(uint256){
        return buy(symbol, msg.value, referredBy);
    }

    function buy(string symbol, uint256 incomingTokenAmount, address referredBy) public payable returns(uint256){
        //require(tokenRegistry.isTokenRegisteredBySymbol(symbol));

        TokenDealerInterface dealer = TokenDealerInterface(tokenDealerMap[symbol]);

        uint256 receiveTokens = dealer.purchaseTokens(incomingTokenAmount, referredBy);

        emit onTokenPurchase(msg.sender, symbol, incomingTokenAmount, receiveTokens, referredBy);

        return receiveTokens;
    }   

    function tokenAddress(string symbol) public view returns (address) {
        return tokenDealerMap[symbol];
    }
}
